Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('1','Gazania','La gazania es una planta de exterior ideal para principiantes, pues no requiere de muchos cuidados y está casi todo el año.','6000','40','productos/Flor1.jpg','1');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('2','Azaleas','Por lo general, las azaleas prefieren ambientes frescos, pero no carentes de luz natural. De esta manera, en el caso de tenerlas dentro de nuestras casas deberemos asegurarnos de tenerlas en una zona ventilada y alejada de la calefacción.','3990','40','productos/Flor2.jpg','1');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('3','Crisantemo amarillo','Mientras que algunas plantas necesitan buen tiempo, temperaturas elevadas y mucho sol, otras, como el Crisantemo, florecen con la llegada del otoño.','7000','40','productos/Flor3.jpg','1');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('4','Rosas naranjas','Rosas naranjas, la flor perfecta para transmitir alegría. Las connotaciones de las rosas naranjas van en la misma línea que el propio color. Con ellas podemos transmitir alegría, simpatía e, incluso, poner en valor la amabilidad de la persona que las va a recibir.','10000','40','productos/Flor4.jpg','1');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('5','Tulipanes','El tulipán es un símbolo de amor sincero. Es una flor increíblemente romántica que al regalarla expresas enamoramiento, pasión, amor incondicional, amor puro, etc.','6000','40','productos/Flor5.jpg','1');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('6','Amarilis','Las flores son simplemente lo más hermoso de esta planta, De hecho, esta planta brilla con una sola flor espectacular, cuyo tamaño difícilmente puede ser superado.','12000','40','productos/Flor6.jpg','1');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('7','Gymnocalycium','El Gymnocalycium, también conocido popularmente como cactus chin enano, es una especie de         planta familia de las Cactaceae de origen sudamericano.','4500','40','productos/cactus1.jpg','3');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('8','Mammillaria bocasana','La Mammillaria bocasana, es un cactus aglomerado, que a menudo forma grandes montículos.             Tiene una apariencia de bola de algodón, ya que la pequeña planta redonda, está cubierta de sedosos pelos             blancos.','5500','40','productos/cactus2.jpg','3');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('9','Opuntia microdasys','La Opuntia microdasys, también conocida como cactus oreja de conejo o alas de ángel, es en pequeño primo del más conocido cactus nopal. Aunque no es conocido por sus usos culinarios, es una planta de interior y exterior muy popular por su fácil cuidado y su bonito aspecto.','7990','40','productos/cactus3.jpg','3');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('10','Haworthia fasciata','Esta especie prefiere las arenas ácidas del tipo de vegetación fynbos, en la zona                         cercana a Port Elizabeth y Uitenhage, en el Cabo Oriental, Sudáfrica.','5990','40','productos/cactus4.jpg','3');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('11','Cereus Peruvianus','El Cereus peruvianus es nativo de afloramientos rocosos y de la sabana en América                         del Sur, probablemente nativa del Caribe occidental y Venezuela o Brasil.','7000','40','productos/cactus5_gVYJhrW.jpg','3');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('12','Conophytum bilobum','Este es un conophytum común y fácil de cultivar, que produce unas bellas flores amarillas generalmente. Es la más fácil de todos los conophytum para conseguir un buen crecimiento sin problemas. Es una planta multiforme, con muchas variantes morfológicas y hasta geográficas que las hace ser como plantas o especies independientes.','6990','40','productos/cactus6.jpg','3');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('13','Raid essentials','Mata Hormigas, Cucarachas, Pulgas, Arañas, Zancudos, Moscas, Mosquitos y Cienpiés sin perjudicar las plantas. Su efectiva fórmula de base acuosa mata moscas y mosquitos con un 80% menos de solventes químicos que los insecticidas tradicionales y sin causar daño a sus plantas.','3500','40','productos/pesticida1_chiquito.jpg','2');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('14','Clorox antihongos','Elimina con éxito las concentraciones de cloro y pesticidas gracias a su fina filtración','3500','40','productos/pesticida2.png','2');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('15','Tanax insecticida po','Tanax Insecticida Polvo, tiene una formula superactiva con acción inmediata y enérgica, matando al contacto insectos como: Hormigas, cucarachas, pulgas, polillas, chinches. etc.','4500','40','productos/pesticida3.png','2');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('16','Maceta de plastico','Algunos de los plásticos más comunes en las macetas son: El Polipropileno (PP) que se             identifica con el número 5, el Polietileno de alta densidad (HDPE), número 2 y el Polietileno de baja             densidad (LDPE), número 4.','2500','40','productos/Maceta_1.jpg','4');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('19','Maceta de greda','Es porosa y se seca con gran facilidad. El que sea porosa implica que, si un macetero de greda se coloca en una terraza muy helada, absorberá la humedad ambiente, con lo que la planta y sus raíces correrán el riesgo de congelarse','8500','40','productos/maceta_3.jpg','4');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('20','Maceta alta_plastic','Este tipo de macetas es mas que nada utilizado en oficinas, restaurantes o casas mas lujosas','7000','40','productos/Maceta_4.jpg','4');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('21','Maceta de ceramica','Las macetas de cerámica se fabrican a partir de arcillas naturales y componentes                         minerales mezclados con aditivos de diferente naturaleza.','7500','40','productos/Maceta_5.jpg','4');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('18','Maceta peque_plastic','es una maceta mas pequeña que las comunes hechas de plastico y al esta misma ser mas                         pequeña es de un plastico mas resistente al comun para no ser menos que las demas','1000','40','productos/Maceta_2_cxVehn6.jpg','4');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('22','Maceta de arcilla','Se trata de una maceta que aguanta perfectamente el frío y heladas, es porosa y 100% natural. Incluye agujero en la base para drenar el exceso de agua y que no se pudran las raíces. La Maceta de Barro es el accesorio perfecto para tus plantas, ya que ofrece calidez, porosidad y está hechas de materiales naturales.','6000','40','productos/Maceta_6.jpg','4');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('23','fertilizante anasac','Por lo general tienen un plazo de respuesta de 30 días aproximadamente. Son fácilmente             solubles en agua y a menudo se aplican disueltos en agua a través de un rociador.','15000','40','productos/Fertilizante1.png','5');
Insert into SE_VENDEN_PLANTAS.MENU_PRODUCTO (ID_PROD,NOMBRE_PROD,DESCRIPCION,PRECIO,STOCK,IMAGEN,CATEGORIA_ID) values ('24','Gas Agricola','Por lo general tienen un plazo de respuesta de 30 días aproximadamente. Son fácilmente             solubles en agua y a menudo se aplican disueltos en agua a través de un rociador.','12000','40','productos/Fertilizante2.png','5');
